mongoose.connect(url)
    .then(console.log("database connected successfully"));

    const s3=new aws.S3({
        accessKeyId:process.env.AWS_ACCESS_KEY_ID,
        secretAccessKey:process.env.AWS_SECRET_ACCESS_KEY,
        signatureVersion:'v4'
    })

app.post('/images', async (req, res) => {
    // const base64code = req.body.base64code;
    const base64code = " ";
    // console.log(base64code);
    const buffer = Buffer.from(base64code, "base64");
    // fs.writeFileSync("new-path.jpg", buffer);
    // const fileInfo = fileType(buffer);
//    console.log(fileInfo);
   const key=uuidv4()+".jpg";
   console.log(key);
   const imageSchema = new mongoose.Schema({
    key: String
});

const Image = mongoose.model('Image', imageSchema);
    const params={
        Bucket:process.env.BUCKET,
        Key:key,
        Body:buffer,
    };
    try {
        const image = new Image({ key: key });
        await image.save();
        console.log('Image URL saved to database');
        // res.status(200).send('Image uploaded successfully');
      } catch (error) {
        console.error('Error saving image URL to database:', error);
        res.status(500).send('Error saving image URL to database');
      }
     s3.upload(params,  (err, data) => {
        if (err) {
            console.error(err);
            return res.status(500).json({ error: 'Failed to upload image' });
        }
        // const image = new Image({ Key:key });
        //           await image.save()
                //    .then(console.log("image added to mongodb"));
               
       
        const signedUrl = s3.getSignedUrl('getObject', {
            Bucket: process.env.BUCKET,
            Key: key,
            Expires: 3600,
        });
        res.json({ imageUrl: signedUrl });
    }
   );
    // res.json("done");
});






